import { CWidgetProgressIcon } from "@coreui/react";
import CIcon from "@coreui/icons-react";
const DWidget = (props) => {
  return (
    <CCol sm="12" md="3">
      <CWidgetProgressIcon
        header={props.value}
        text={props.text}
        color={props.color}
        inverse
      >
        <CIcon name={props.icon} height="36" />
      </CWidgetProgressIcon>
    </CCol>
  );
};
export default DWidget;
